import React from 'react';
import { motion } from 'framer-motion';

// Single Slack Message
const Message = ({ time, title, bullets }) => (
  <motion.div
    initial={{ opacity: 0, y: 20 }}
    whileInView={{ opacity: 1, y: 0 }}
    viewport={{ once: true }}
    transition={{ duration: 0.5, ease: 'easeOut' }}
    className="flex items-start gap-3 bg-white p-4 rounded-lg shadow transition-all w-full"
  >
    {/* Avatar */}
    <div className="flex-shrink-0">
      <div className="w-8 h-8 rounded-full bg-[#0052cc] flex items-center justify-center text-white font-bold text-sm">
        R
      </div>
    </div>

    {/* Content */}
    <div className="text-left flex-1">
      <div className="flex items-center gap-2 mb-1">
        <p className="font-bold text-[#111827] text-sm">Relam Insights</p>
        <span className="text-xs text-gray-400">{time}</span>
      </div>
      <div className="text-[#374151] text-sm leading-relaxed">
        <p className="font-semibold mb-1">{title}</p>
        <ul className="list-disc list-inside space-y-1 text-[13px]">
          {bullets.map((bullet, idx) => (
            <li key={idx}>{bullet}</li>
          ))}
        </ul>
      </div>
    </div>
  </motion.div>
);

function SlackWorkspaceMockup() {
  const messages = [
    {
      time: "9:34 AM",
      title: "New Competitor Alert",
      bullets: [
        "Acme Corp launched a new product line.",
        "Pricing changes detected on BetaCorp's website."
      ]
    },
    {
      time: "9:37 AM",
      title: "Customer Churn Risk Detected",
      bullets: [
        "2 strategic accounts showed decreased engagement last week.",
        "Recommended proactive retention outreach."
      ]
    },
    {
      time: "9:41 AM",
      title: "Expansion Opportunity",
      bullets: [
        "GammaCorp added 3 new regions in their CRM.",
        "Potential upsell detected in enterprise segment."
      ]
    }
  ];

  const channels = [
    "# general",
    "# sales",
    "# product-marketing",
    "# customer-success",
    "# growth-team",
    "# competitive-intelligence",
    "# engineering",
    "# design",
  ];

  return (
    <div className="rounded-2xl overflow-hidden shadow-2xl mx-auto max-w-7xl border border-gray-200 bg-gray-100">
      {/* MacOS Window Header */}
      <div className="flex items-center gap-2 p-2 bg-[#f5f5f5] border-b border-gray-300">
        <div className="w-3 h-3 rounded-full bg-red-400"></div>
        <div className="w-3 h-3 rounded-full bg-yellow-400"></div>
        <div className="w-3 h-3 rounded-full bg-green-400"></div>
      </div>

      <div className="flex h-[600px]">
        {/* Sidebar */}
        <div className="bg-[#350D36] w-56 flex flex-col text-white text-sm">
          {/* Workspace Switchers */}
          <div className="flex items-center justify-center py-4 space-x-2 border-b border-[#52244a]">
            <div className="w-6 h-6 rounded-md bg-gray-300"></div>
            <div className="w-6 h-6 rounded-md bg-gray-500"></div>
          </div>

          {/* Channels List */}
          <div className="flex flex-col px-3 py-4 space-y-1 overflow-y-auto">
            {channels.map((channel, idx) => (
              <div
                key={idx}
                className={`p-2 rounded cursor-pointer ${
                  channel === '# competitive-intelligence'
                    ? 'bg-[#1264A3] font-bold'
                    : 'hover:bg-[#421f44]'
                }`}
              >
                {channel}
              </div>
            ))}
          </div>
        </div>

        {/* Main Chat Area */}
        <div className="flex-1 flex flex-col bg-white">
          {/* Top Bar with Tabs */}
          <div className="flex items-center justify-between px-6 py-3 border-b border-gray-200">
            <div className="flex items-center gap-6">
              <p className="font-semibold text-[#111827]"># competitive-intelligence</p>
              <div className="flex items-center gap-4 text-gray-500 text-sm">
                <span className="font-semibold text-[#111827] cursor-pointer">Home</span>
                <span className="cursor-pointer hover:text-[#111827]">Messages</span>
                <span className="cursor-pointer hover:text-[#111827]">About</span>
              </div>
            </div>
            <div className="bg-gray-100 px-3 py-2 rounded text-gray-400 text-sm w-48 text-left">Search...</div>
          </div>

          {/* Messages */}
          <div className="flex flex-col gap-4 p-6 overflow-y-auto">
            {messages.map((msg, idx) => (
              <Message key={idx} {...msg} />
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default SlackWorkspaceMockup;
